package cn.kingnet.utp.sdk.account.api.user.account;

import cn.kingnet.utp.sdk.account.AccountClient;
import cn.kingnet.utp.sdk.account.api.UtpAccountTestCase;
import cn.kingnet.utp.sdk.account.dto.AuthBindEntReqDTO;
import cn.kingnet.utp.sdk.account.dto.AuthBindEntRespDTO;
import cn.kingnet.utp.sdk.core.dto.ServerResponse;
import cn.kingnet.utp.sdk.core.enums.AuthType;
import cn.kingnet.utp.sdk.core.enums.HttpRespStatus;
import com.alibaba.fastjson.JSON;
import lombok.extern.slf4j.Slf4j;
import org.junit.Test;

/**
 * @Description: 企业鉴权、绑卡功能合并
 * @Author sheqingquan@scenetec.com
 * @Create 2019/5/29 18:13
 */
@Slf4j
public class API_05_AuthBindEntTest extends UtpAccountTestCase {

	/**
	 * 测试入口
	 * @throws Exception
	 */
	@Test
	public void test() {
		try {
			AccountClient client = new AccountClient(createAuthorization(AuthType.HTSIGN), host);
			AccountClient.Builder<AuthBindEntRespDTO> builder = client.newAuthBindEntRespBuilder();
			// 初始化requestBody
			AuthBindEntReqDTO reqDTO = new AuthBindEntReqDTO();
			reqDTO.setClientTradeId(String.valueOf(System.currentTimeMillis()));
			reqDTO.setUserAccount("9100001101000002152");
			reqDTO.setAcctNo("100000000000000000000");
			reqDTO.setAcctName("测试账户名");
			reqDTO.setOpBankCode("999999999999999999");
			reqDTO.setOpBankName("建设银行");
			reqDTO.setClBankCode("33333333333333333");
			reqDTO.setBusinessLicensePic("");
			reqDTO.setPersonPicA("");
			reqDTO.setPersonPicB("");
			reqDTO.setCallbackUrl("http://www.baidu.com");
			reqDTO.setLicensePic("");
			builder.setReqData(reqDTO);


			log.info("企业账户鉴权绑卡 请求报文:{}", JSON.toJSONString(builder.getReqData()));

			ServerResponse<AuthBindEntRespDTO> serverResponse = send(builder);

			if (serverResponse.getRespData() == null) {
				log.error("企业账户鉴权绑卡异常：响应结果为null", serverResponse.getThrowable());
			} else {
				AuthBindEntRespDTO respDTO = serverResponse.getRespData();
				log.info("企业账户鉴权绑卡 响应报文:{}", JSON.toJSONString(respDTO));
				HttpRespStatus httpRespStatus = HttpRespStatus.resolve(respDTO.getStatus());
				if (httpRespStatus.is2xxSuccessful()) {
					log.info("企业账户鉴权绑卡受理成功");
				} else {
					log.error("企业账户鉴权绑卡受理失败：status[{}] {}", respDTO.getStatus(),respDTO.getMessage());
				}
			}
		} catch (Exception e) {
			log.error("企业账户鉴权绑卡异常：{}", e.getMessage(), e);
		}
	}
}
